function ActivitiesPage() {
    return(
        <div className='activities'>
            <div className="activity-header">
                <PageTitle 
                    image={flowerImage}
                    pageTitle="Activities"
                />
                <p>As always, here at Stardust, there are plenty of activities to keep you and the family engaged and entertained.</p>
                <p>Please contact the front office at <span style={{ color: 'rgb(61, 132, 7)'}} onClick={() => window.open("tel:+15305445211")}><strong>(530) 544-5211</strong></span> for information about this weekâ€™s activities.</p>
            </div>

            <ActivityList />
        </div>
    )

}

export default ActivitiesPage;
